import React from "react";

class Navigation extends React.Component {
    render() {
        return (
            <div className="navigation">
                <div className="nav">
                    <img src="./png/icons_compare.png" alt="hi" />
                    <div className="nav1"></div>
                    <div className="nav2"></div>
                </div>
            </div>
        )
    }
}

export default Navigation;
